class Clients extends Component {
  render() {

    const clients = [{
      id: "453473957",
      firstName: 'Kevin',
      lastName: 'Johnson',
      email: 'kevin@gmail.com',
      phone: '555-555-5555',
      balance: '30'
    }];

    if (clients) { 
      return (
        <div>
          <div className="row">
            <div className="col-md-6">
              <i className="fas fa-users"> Clients </i>
            </div>
            <div className="col-md-6">

            </div>
          </div>
        </div>
      );
    } else {
      return <h1>Loading...</h1>
    }
  }
}

export default Clients;
